// Expand raw data into full objects
let idCounter = 0;
export const OBJECTS = RAW.map(raw => {
  idCounter++;
  const id = `obj-${String(idCounter).padStart(3, '0')}`;
  const volume = raw.v;
  return {
    id,
    name: raw.n,
    tags: raw.t,
    volume_liters: volume,
    size: deriveSize(volume),
    dateObtained: raw.d,
    lastUsed: raw.l,
    usageFrequency: raw.u,
    attachment: raw.a,
    status: 'keeping',
    description: raw.desc,
    icon: raw.i,
    detail: raw.det || null,
  };
});
